import React from 'react';
import Carousel from './Carousel';
import { Consumer } from './Context/context.js';

const Explore = () => {
    return (
      <div className="App">
        <Consumer>
        { context => {

            console.log("From Explore: ", context.actions.getMovies);

            return (
                //In Theaters
                <Carousel
                    endpoint='https://api.themoviedb.org/3/movie/now_playing?api_key=9512b36f031887e7c9ad226e2c26a6b2&language=en-US&page=1'
                    getMovies={context.actions.getMovies}
                />
            );
        }}
        </Consumer>
      </div>
    );
} 

export default Explore;
